import React from 'react';
import './Footer.css';
import whatsapp from './imgs/whatsapp.png';
import github from './imgs/github.png';
import instagram from './imgs/instagram.png';
import logo from './imgs/logo_site.png';
import mail from './imgs/carta.png';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="logo-container">
          <img className="logo" src={logo} alt="Logo" />
          <p>DATAVERSE</p>
          <hr className="separator" />
        </div>
        <div className="icons-container">
          <nav>
            <ul>
              <li><a href="#"><img className="icon" src={whatsapp} alt="WhatsApp" /></a></li>
              <li><a href="#"><img className="icon" src={github} alt="GitHub" /></a></li>
              <li><a href="#"><img className="icon" src={instagram} alt="Instagram" /></a></li>
            </ul>
          </nav>
          <hr className="separator" />
        </div>
        <hr className="separator" />
        <div className="mail-container">
          <a>
          <img src={mail} alt="Mail" />
          dataverse4@gmail.com
          </a>
        </div>
        <div className="direitos">
        <p>© {new Date().getFullYear()} DataVerse - Todos os direitos reservados</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
